import { useEffect, useState } from "react";
import "../App.css";
import logoImg from "../img/logo.jpg";
import axios from "axios";
import url from "../host";

function Home() {
  const [text, setText] = useState("");
  const [data, setData] = useState([]);
  function handlePress() {
    localStorage.clear();
    window.location = "/";
    window.reload();
  }
  function handlePress2() {
    console.log("key");
    document.querySelector(".Main02").style = "display: block";
    var textt = document.querySelector(".inpp").value;
    setText(textt);
    axios
      .get(`${url}/api/orders/search?trek_id=${textt}`)
      .then((res) => {
        if (res.data.length === 0) {
          console.log("aasdfu231234");
          setData(null);
        } else {
          setData(res.data);
          console.log(res.data);
          console.log(res.data.id);
        }
      })
      .catch((err) => {
        console.log(err);
      });
  }
  return (
    <div className="App">
      <div className="navbar">
        <div className="minNav">
          <img src={logoImg} alt="" />
          {localStorage.getItem("key") ? (
            localStorage.getItem("key") == 1 ? (
              <div
                className="bgasc"
                style={{
                  width: "27%",
                  display: "flex",
                  justifyContent: "space-between",
                }}
              >
                <a href="/profile">
                  <button>Профиль</button>
                </a>
                <a href="/admin">
                  <button>Админ панел</button>
                </a>

                <button onClick={() => handlePress()}>Выйти</button>
              </div>
            ) : localStorage.getItem("key") == 2 ? (
              <div
                style={{
                  width: "15%",
                  display: "flex",
                  justifyContent: "space-between",
                }}
              >
                <a href="/profile">
                  <button>Профиль</button>
                </a>
                <button onClick={() => handlePress()}>Выйти</button>
              </div>
            ) : localStorage.getItem("key") == 3 ? (
              <div
                className="bgasc"
                style={{
                  width: "27%",
                  display: "flex",
                  justifyContent: "space-between",
                }}
              >
                <a href="/profile">
                  <button>Профиль</button>
                </a>
                <a href="/manager">
                  <button>Админ панел</button>
                </a>

                <button onClick={() => handlePress()}>Выйти</button>
              </div>
            ) : (
              <a href="/login">
                <button>Войти</button>
              </a>
            )
          ) : (
            <a href="/login">
              <button>Войти</button>
            </a>
          )}
          {/* {localStorage.getItem("key") ? (
            <a href="/profile">
              <button>Профиль</button>
              <button
                style={{ marginLeft: "10px" }}
                onClick={() => handlePress()}
              >
                Выйти
              </button>
            </a>
          ) : (
            <a href="/login">
              <button>Войти</button>
            </a>
          )} */}
        </div>
      </div>
      <div className="header">
        <div className="shadowDiv" />
        <div className="inputForm">
          <input
            type="text"
            placeholder="Введите трек-код (номер отслеживания)"
            className="inpp"
          />
          <button onClick={() => handlePress2()}>Найти</button>
        </div>
      </div>
      <div className="Main02">
        {data === null ? (
          <div>
            <center>
              <h1>No results!</h1>
            </center>
          </div>
        ) : (
          <>
            {data.map((item) => {
              return (
                <div
                  className="Main"
                  style={{
                    backgroundColor: "#0d6dfd0a",
                    display: "none",
                  }}
                >
                  <center>
                    <h1>Статус заказ: {item.id}</h1>
                  </center>
                  <div
                    style={{
                      display: "flex",
                      justifyContent: "space-between",
                      width: "60%",
                      margin: "auto",
                    }}
                  >
                    <h1>Отправ</h1>
                    <h1>Кому</h1>
                  </div>
                  <div
                    style={{
                      display: "flex",
